import 'react';

class Inputs extends React.Component {
    render () {
        return (
            <div className="Inputs">
                <header className="Inputs-header">
                <div> 
                    <input type="radio" name="foo" id="foo1" checked="true" />
                    <label for="foo1">1 for foo</label>

                    <input type="radio" name="bar" id="bar1" checked="true" />
                    <label for="bar1">1 for bar</label>

                    <input type="radio" name="foo" id="foo2" />
                    <label for="2">2 for foo</label>

                    <input type="radio" name="bar" id="bar2" />
                    <label for="bar2">2 for bar</label>
                </div>

                </header>
            </div>
        );
    }
}

  export default Inputs;
